DROP TABLE cidades;
CREATE TABLE cidades (
	estado CHAR(2),
	cidade VARCHAR(100)
);

--EXERCICIO 01 TABELA CIDADES----------------------------------------------
--Selecione o estado e cidade
SELECT estado, cidade
	FROM cidades;

--EXERCICIO 02 TABELA CIDADES----------------------------------------------
--Selecione as cidades que começam com a letra A.

SELECT cidade
	FROM cidades
	WHERE cidade LIKE 'a%';

--EXERCICIO 03 TABELA CIDADES----------------------------------------------
-- Selecione as cidades que contenham no ‘apar’ em qualquer parte do nome

SELECT cidade
	FROM cidades
	WHERE cidade LIKE '%apar%';

--EXERCICIO 04 TABELA CIDADES----------------------------------------------
--Selecione as cidades que começam com a letra W.

SELECT cidade
	FROM cidades
	WHERE cidade LIKE 'W%';

--EXERCICIO 05 TABELA CIDADES----------------------------------------------
-- Selecione o estado e a cidade que a cidade termina com ‘tuba’ 
--ordenando pelo estado em ordem decrescente.

SELECT estado, cidade
	FROM cidades
	WHERE cidade LIKE '%tuba'
	ORDER BY estado DESC;

--EXERCICIO 06 TABELA CIDADES----------------------------------------------
--Selecione a cidade que o nome da cidade contenha mais que 15 caracteres, 
--ordenando pelo quantidade de caracteres.

SELECT cidade
	FROM cidades
	WHERE LEN (cidade) > 15
	ORDER BY LEN (cidade);

--EXERCICIO 07 TABELA CIDADES----------------------------------------------
--Contabilize a quantidade de cidades do estado de SC.

ALTER TABLE cidades ADD cidades_sc INT;
	SELECT cidades_sc = COUNT (cidade)
	FROM cidades
	WHERE estado = 'SC';

--EXERCICIO 08 TABELA CIDADES----------------------------------------------
--Contabilize a quantidade de cidades do estado de SP.

ALTER TABLE cidades ADD cidades_sp INT;
SELECT cidades_sp = COUNT (cidade)
FROM cidades
WHERE estado = 'SP';

--EXERCICIO 09 TABELA CIDADES----------------------------------------------
--Selecione o nome da cidade com a quantidade de caracteres, 
--quando o nome da cidade conter 10 caracteres.

ALTER TABLE cidades ADD qtd_caracteres INT;
SELECT cidade, qtd_caracteres = (LEN(cidade))
FROM cidades
WHERE LEN (cidade) = 10;






