CREATE TABLE pokemons (
	id					INT IDENTITY(1,1) PRIMARY KEY,
	nome				VARCHAR(255),
	codigo				VARCHAR(4),
	categoria			VARCHAR(255),
	altura				FLOAT,
	peso				FLOAT,
	hp					INT,
	ataque				INT,
	defesa				INT,
	especial_ataque		INT,
	especial_defesa		INT,
	velocidade			INT,
	descricao			TEXT
 );


--EXERCICIO 01  TABELA POKEMONS--------------------------------------------
--SELECIONE TODAS AS COLUNAS-----------------------------------------------

SELECT id, nome, codigo, categoria, descricao, altura, peso, hp, ataque, defesa, especial_ataque, especial_defesa, velocidade
	FROM pokemons;

--EXERCICIO 02  TABELA POKEMONS--------------------------------------------
--SELECIONE O ATAQUE, ATAQUE ESPECIAL, DEFESA E DEFESA ESPECIAL------------

SELECT ataque, especial_ataque, defesa, especial_defesa
	FROM pokemons;

--EXERCICIO 03  TABELA POKEMONS--------------------------------------------
--SELECIONE NOME, CATEGORIA E ATAQUE, ORDENANDO PELO ATAQUE EM ORDEM CRESCENTE

SELECT nome, categoria, ataque
	FROM pokemons
	ORDER BY ataque ASC;

--EXERCICIO 04  TABELA POKEMONS--------------------------------------------
--SELECIONE ALTURA, PESO, COM O CÁLCULO DO IMC

ALTER TABLE pokemons ADD imc FLOAT;
	UPDATE pokemons SET imc = peso / (altura * altura);

SELECT altura, peso, imc
	FROM pokemons;

--EXERCICIO 05 TABELA POKEMONS--------------------------------------------
--SELECIONE ALTURA, PESO, COM O CÁLCULO DO IMC, ORDENANDO O IMC EM ORDEM DECRESCENTE

SELECT altura, peso, imc
	FROM pokemons
	ORDER BY imc DESC;

--EXERCICIO 06 TABELA POKEMONS--------------------------------------------
--SELECIONE nome e o tamanho do nome em ordem decrescente pelo nome

ALTER TABLE pokemons ADD tamanho_nome INT;

SELECT nome, tamanho_nome = LEN (nome)
	FROM pokemons
	ORDER BY LEN (nome) DESC;

--EXERCICIO 07 TABELA POKEMONS--------------------------------------------
--Selecione nome, descrição, quando o nome contiver mais que 10 caracteres.

SELECT nome, descricao 
	FROM pokemons
	WHERE LEN(nome) > 10;

--EXERCICIO 08 TABELA POKEMONS--------------------------------------------
--Selecione nome, categoria, e ataque do pokemon que contém o menor valor de ataque.

SELECT nome, categoria, ataque
	FROM pokemons
	WHERE ataque = (SELECT MIN (p.ataque)
	FROM pokemons p);

--EXERCICIO 09 TABELA POKEMONS--------------------------------------------
--Selecione o ataque, ataque especial, nome, defesa e defesa especial ordenando pelo ataque
	
SELECT ataque, especial_ataque, nome, defesa, especial_defesa
	FROM pokemons
	ORDER BY ataque;

--EXERCICIO 10 TABELA POKEMONS--------------------------------------------
-- Selecione a média dos ataques.
ALTER TABLE pokemons ADD media_ataques INT
SELECT media_ataques = AVG (ataque)
	FROM pokemons;

--EXERCICIO 11 TABELA POKEMONS--------------------------------------------
--Selecione a somatória dos ataques.
ALTER TABLE pokemons ADD soma_ataques INT
SELECT soma_ataques = SUM (ataque)
	FROM pokemons;

--EXERCICIO 12 TABELA POKEMONS--------------------------------------------
--Selecione a média dos ataques especiais quando o nome do pokemon começar com ‘P’.

ALTER TABLE pokemons ADD media_ataque_especiais INT
SELECT media_ataque_especiais = AVG (especial_ataque)
FROM pokemons 
WHERE nome LIKE 'p%';




